import axios from 'axios';

const http = axios.create({
    baseURL: 'http://localhost:5004/api',
});
export default {
    getGuestbookEntries() {
        return http.get('/guestbooks');
    },
    addGuestbook(entry) {
        return http.post('/guestbooks', entry);
    },
}
